An Overview:

The Ahmadiyya Muslim Community is a dynamic, fast growing international revival movement within Islam. Founded in 1889, it spans over 206 countries with membership exceeding tens of millions. Its current headquarters are in the United Kingdom.

Ahmadiyya Muslim Community is the only Islamic organization to believe that the long-awaited Messiah has come in the person of Mirza Ghulam Ahmad(as) (1835-1908) of Qadian. Ahmad(as) claimed to be the metaphorical second coming of Jesus(as) of Nazareth and the divine guide, whose advent was foretold by the Prophet of Islam, Muhammad(sa).
